/**
 * Input: itens do "Get list members" (cada item = um membro).
 * Campo alvo (nome do responsável): $('Webhook').first().json.body["Responsável"].Label
 * Saída: único item com assigneeId, assigneeUsername, debug.
 */

// Nome vindo do Webhook
const targetRaw = $('Webhook').first().json.body?.["Responsável"]?.Label;
if (!targetRaw) {
  throw new Error('Nome do responsável não encontrado em Webhook.body["Responsável"].Label');
}

// Normalização: trim, minúsculas, sem acentos e espaços repetidos
const normalize = (s) => String(s || '')
  .normalize('NFD')
  .replace(/[\u0300-\u036f]/g, '') // remove diacríticos
  .toLowerCase()
  .replace(/\s+/g, ' ')
  .trim();

const target = normalize(targetRaw);

// Coleta os membros vindos do node anterior (cada item.json é um membro)
const members = $input.all().map(i => i.json);

// Estratégia de match:
// 1) match exato por username normalizado
// 2) match exato por email (se o webhook tiver email no futuro, adapte aqui)
// 3) match por "contains" no username
let match =
  members.find(m => normalize(m.username) === target) ||
  members.find(m => normalize(m.email) === target) ||
  members.find(m => normalize(m.username).includes(target));

// Se não achar, tentamos um fallback simples por primeiras palavras (ex.: "Miqueias Brandão" vs "Miquéias Brandão")
if (!match) {
  const parts = target.split(' ').filter(Boolean);
  if (parts.length >= 2) {
    const firstLast = `${parts[0]} ${parts[parts.length - 1]}`;
    match = members.find(m => normalize(m.username) === firstLast) ||
            members.find(m => normalize(m.username).includes(firstLast));
  }
}

// Retorna um único item com o id (ou null)
return [{
  json: {
    assigneeId: match?.id ?? null,
    assigneeUsername: match?.username ?? null,
    searchedName: targetRaw,
    found: Boolean(match),
    _debug: {
      membersCount: members.length,
      sampleUsernames: members.slice(0, 5).map(m => m.username),
    }
  }
}];

/**
 * Entrada esperada:
 * $input.first().json.custom_fields = [
 *   { id: '23fd2c36-...', name: '...', options: [ {id, name, ...}, ... ] },
 *   ...
 * ]
 * Nome a buscar: do Webhook -> body.Cliente.Label
 */

const CUSTOM_FIELD_ID = '23fd2c36-e70e-4f9f-971a-86ed77c46a57';

// Nome vindo do Webhook (ajuste se precisar outro caminho)
const searchNameRaw = $('Webhook').first().json.body.Cliente.Label;
if (!searchNameRaw) {
  throw new Error('Nome de busca vazio (Webhook.body.Cliente.Label).');
}

const norm = (s) => String(s || '').trim().toLowerCase();

const customFields = $input.first().json?.custom_fields;
if (!Array.isArray(customFields)) {
  throw new Error('custom_fields não encontrado ou não é array na entrada do Code.');
}

// Localiza o custom field alvo
const cf = customFields.find(f =>
  f?.id === CUSTOM_FIELD_ID || f?.field_id === CUSTOM_FIELD_ID
);

if (!cf) {
  return [{
    json: {
      selectedOptionId: null,
      _debug: 'Custom field alvo não encontrado.',
      fieldIdProcurado: CUSTOM_FIELD_ID,
      disponiveis: customFields.map(f => f.id),
    }
  }];
}

// Em algumas respostas do ClickUp, options pode vir em cf.options ou cf.type_config.options
const options = Array.isArray(cf.options) ? cf.options
  : Array.isArray(cf?.type_config?.options) ? cf.type_config.options
  : null;

if (!options) {
  return [{
    json: {
      selectedOptionId: null,
      _debug: 'Nenhum options[] encontrado dentro do custom field.',
      fieldEncontrado: cf.id,
    }
  }];
}

// Match: tenta primeiro exato (case-insensitive), depois contém
const target = norm(searchNameRaw);
let match = options.find(o => norm(o.name ?? o.label ?? o.value ?? o.text) === target);
if (!match) {
  match = options.find(o => norm(o.name ?? o.label ?? o.value ?? o.text).includes(target));
}

// Saída: adiciona o id da option escolhida
return [{
  json: {
    selectedOptionId: match?.id ?? null,
    selectedOptionName: match ? (match.name ?? match.label ?? match.value ?? match.text) : null,
    _debug: {
      buscado: searchNameRaw,
      optionsCount: options.length,
      fieldId: cf.id,
      matchEstrito: !!match && norm(match.name ?? match.label ?? match.value ?? match.text) === target
    }
  }
}];

